package StringBuilder;


public class _136_Find_the_Difference {
    public static void main(String[] args) {
        String s = "", t = "";

        int[] A = new int[256];
        int[] B = new int[256];

        for (int i = 0; i < s.length(); i++) {
            char ch = s.charAt(i);
            A[ch-'\0']=++A[ch-'\0'];
        }

        for (int i = 0; i < t.length(); i++) {
            char ch = t.charAt(i);
            B[ch-'\0']=++B[ch-'\0'];
        }

        for (int i = 0; i < 256; i++) {
            if(A[i]+1==B[i]){
                System.out.println((char) i);
            }
        }

    }
}
